(2133, 'elementor_pro_remote_info_api_data_3.4.1', 'a:2:{s:7:\"timeout\";i:1665367974;s:5:\"value\";s:66112:\"{\"stable_version\":\"3.9.0-dev2\",\"last_updated\":\"2022-10-03 20:17:57\",\"sections\":\"a:2:{s:11:\\\"description\\\";s:161:\\\"Elementor Pro adds new features to the Elementor Page Builder plugin. Control your conversions, your user engagement, your entire website, from one page builder.\\\";s:9:\\\"changelog\\\";s:62684:\\\"<h2>Elementor Pro - by Elementor.com<\\/h2>\\n<h4>3.9.0-dev2 - 2022-10-03<\\/h4>\\n<ul>\\n<li>Fix: Change the version recommendation to 3.7.7 instead of 3.8.0 [ED-8320] (#1891)<\\/li>\\n<li>Fix: Change the version recommendation to 3.7.7 instead of 3.8.0 [ED-8320] (#1892)<\\/li>\\n<li>Fix: Page Transitions - Nav Menu items with submenu triggers transition instead of opening [ED-8022] (#1886)<\\/li>\\n<li>Fix: Search results not found in site editor [ED-8305] (#1899)<\\/li>\\n<li>Fix: Issue with Related Products using WooCommerce Pixel Manager (#16934) [ED-8349] (#1900)<\\/li>\\n<li>Tweak: Added ACF support for loop [ED-8230] (#19898) (#1902)<\\/li>\\n<li>Revert &quot;Internal: Remove unnecessary HTML markup from Container [ED-8383]&quot; (#1908)<\\/li>\\n<\\/ul>\\n<h4>3.9.0-dev1 - 2022-09-20<\\/h4>\\n<ul>\\n<li>Fix: Error message appears on front if WooCommerce is activated (#19553) [ED-8088] (#1824)<\\/li>\\n<li>New: Loop Builder [ED-7715] (#1831)<\\/li>\\n<li>Revert &quot;New: Loop Builder [ED-7715]&quot; (#1838)<\\/li>\\n<li>Fix: Submissions menu item appears at the bottom [ED-8100] (#1830)<\\/li>\\n<li>Fix: Theme Builder menu item appears at the bottom [ED-8098] (#1829)<\\/li>\\n<li>Fix: Inline Font Icons Experiment making the Hotspot Widget Label Icon height bigger [ED-8110] (#1832)<\\/li>\\n<li>Tweak: Notes panel can be resized [ED-7873] (#1823)<\\/li>\\n<li>Fix: Fatal error on Core &lt; 3.7.3 and Pro 3.8.0 [ED-8149] (#1849)<\\/li>\\n<li>Tweak: Allow removing the last imported Kit [ED-8023] (#1827)<\\/li>\\n<li>Fix: Sub conditi