>Fix: Publish pro version to API after build [ARCH-6] (#923)<\\/li>\\n<li>Revert: Utils - Remove temp collection [ED-2052] (#919)<\\/li>\\n<li>Revert &quot;Blockquote widget: Fix - [ED-2060] Alignment right not work in Blockquote widget with Quotation Skin with <\\/li>\\n<\\/ul>\\n<h4>3.3.0-dev4 - 2021-03-21<\\/h4>\\n<ul>\\n<li>Fix: Migration fix to database table indexes in Submissions screen<\\/li>\\n<\\/ul>\\n<h4>3.3.0-dev2 - 2021-03-18<\\/h4>\\n<ul>\\n<li>Tweak: Added context strings to PayPal Button widget<\\/li>\\n<li>Tweak: Added Pro support for Import \\/ Export feature<\\/li>\\n<li>Fix: Table indexes max length was limited 191 in Form Submissions<\\/li>\\n<li>Fix: Improved A11y issues in Nav Menu widget<\\/li>\\n<\\/ul>\\n<h4>3.3.0-dev1 - 2021-03-16<\\/h4>\\n<ul>\\n<li>New: PayPal Button widget - Collect PayPal payments directly from your site<\\/li>\\n<li>Experiment: Submissions - Save all of your form submissions in one place (#1686)<\\/li>\\n<li>Tweak: Added Stay In Column option to Inner Section element (#7956)<\\/li>\\n<li>Tweak: Adjusted \'Max Height\' control range in Table of Contents widget<\\/li>\\n<li>Tweak: Changed descriptive text in Create Custom Code screen<\\/li>\\n<li>Tweak: Added support for dynamic capabilities in Code Highlight widget<\\/li>\\n<li>Tweak: Added support for future load on demand for <code>share-link<\\/code> library<\\/li>\\n<li>Tweak: Added support for future load on demand for <code>dialog<\\/code> library in Popup<\\/li>\\n<li>Tweak: Allow overwriting the assets URL when using a mirror domain<\\/li>\\n<li>Fix: Animation was triggered multiple times when accessing the viewport in certain cases in Animated Headline widget (#13951)<\\/li>\\n<li>Fix: Location is not being updated after a Custom Code snippet is published (#13971)<\\/li>\\n<li>Fix: Custom Fonts CSS files were not updated after regenerating CSS files<\\/li>\\n<li>Fix: Conditions modal is not responsive in Custom Code<\\/li>\\n<li>Fix: Empty order buttons are displayed in Custom Fonts screen<\\/li>\\n<li>Fix: Typo in \'Reply To\' Email action after submit placeholder in Forms widget<\\/li>\\n<li>Fix: Unnecessary Save Draft button in Custom Code<\\/li>\\n<li>Fix: RTL glitches in Custom Code<\\/li>\\n<li>Fix: Sanitized options in the editor to enforce better security policies<\\/li>\\n<li>Deprecated: See all deprecations to this version in our <a href=\\\"https:\\/\\/developers.elementor.com\\/v3-2-planned-deprecations\\/\\\">Developers Deprecations Post<\\/a><\\/li>\\n<\\/ul>\\n<h4>3.2.0-dev7 - 2021-03-11<\\/h4>\\n<p>Tweak: Added an option to filter submissions by page in the Submissions screen\\nTweak: Added the page name in the corresponding submissions column\\nFix: Removed default border from PayPal Button widget\\nFix: Redirect after successful payment is not working<\\/p>\\n<h4>3.2.0-dev6 - 2021-03-08<\\/h4>\\n<p>Tweak: Added an option to export multiple form submissions into one <code>zip<\\/code> file\\nTweak: Added Page Name to Submissions table\\nTweak: Changed currency option <code>Pound Sterling<\\/code> to <code>GBP<\\/code> in PayPal button widget (#14036)\\nTweak: Updated PayPal Button widget icon\\nTweak: Changed descriptive text in Create Custom Code screen\\nTweak: Added URL autocomplete to Redirect after payment control in PayPal button widget\\nTweak: Added support for dynamic capabilities in Code Highlight widget\\nTweak: Make sure no form entity is created when submitting from the preview\\nTweak: Added support for future load on demand for share-link library\\nTweak: Added support for future load on demand for dialog library in Popup\\nTweak: Allow overwriting the assets URL when using a mirror domain\\nFix: Animation was triggered multiple times when accessing the viewport in certain cases in Animated Headline widget (#13951)\\nFix: Custom Fonts CSS files were not updated after regenerating CSS files\\nFix: Export non existing form and fields\\nFix: Empty order buttons are displayed in Custom Fonts screen\\nFix: Sanitized options in the editor to enforce better security policies<\\/p>\\n<h4>3.2.0-dev5 - 2021-02-25<\\/h4>\\n<ul>\\n<li>Tweak: Changed Form Submissions experiment to be active by default<\\/li>\\n<li>Tweak: Changed Form Submissions action after submit label<\\/li>\\n<li>Fix: Location is not being updated after a Custom Code snippet is published (#13971)<\\/li>\\n<li>Fix: Styles aren\\u2019t loading in Admin screen for Form Submissions<\\/li>\\n<li>Fix: Some characters are unreadable in Form Submissions<\\/li>\\n<\\/ul>\\n<h4>3.2.0-dev4 - 2021-02-23<\\/h4>\\n<ul>\\n<li>Fix: Popup event handler is undefined (#11475, #10690)<\\/li>\\n<li>Fix: Minor UI glitches in Code Highlight widget<\\/li>\\n<li>Fix: Users can\'t get Pro Developer Edition version updates<\\/li>\\n<\\/ul>\\n<h4>3.2.0-dev3 - 2021-02-22<\\/h4>\\n<ul>\\n<li>New: PayPal Button widget - Collect PayPal payments directly from your site<\\/li>\\n<li>Experiment: Submissions - Save all of your form submissions in one place (#1686)<\\/li>\\n<li>Tweak: Added Stay In Column option to Inner Section element (#7956)<\\/li>\\n<li>Tweak: Adjusted \'Max Height\' control range in Table of Contents widget<\\/li>\\n<li>Fix: Conditions modal is not responsive in Custom Code<\\/li>\\n<li>Fix: Typo in \'Reply To\' Email action after submit placeholder in Forms widget<\\/li>\\n<li>Fix: Unnecessary Save Draft button in Custom Code<\\/li>\\n<li>Fix: RTL glitches in Custom Code<\\/li>\\n<li>Fix: RTL glitches in Code Highlight widget<\\/li>\\n<li>Fix: Users can\'t get Pro Developer Edition version updates<\\/li>\\n<\\/ul>\\n<h4>3.2.0-dev2 - 2021-02-18<\\/h4>\\n<ul>\\n<li>New: PayPal Button widget<\\/li>\\n<li>Tweak: Added Stay in column Sticky option to Inner element<\\/li>\\n<li>Tweak: Changed Max height limit in Table Of Contents widget<\\/li>\\n<li>Fix: RTL UI glitches in Custom Code<\\/li>\\n<li>Fix: RTL UI glitches in Code Highlight widget<\\/li>\\n<\\/ul>\\n<h4>3.2.0-dev1 - 2021-02-07<\\/h4>\\n<ul>\\n<li>New: Introducing Custom Code - Add custom code snippets to your site, including <code>head<\\/code>, <code>body<\\/code> start and <code>body<\\/code> end<\\/li>\\n<li>New: Meet Code Highlight widget - showcase any syntax with highlighted UI (#5815)<\\/li>\\n<li>Experiment: Improved Pro widgets performance by loading JS and Swiper assets conditionally in frontend (#8572, <a href=\\\"https:\\/\\/developers.elementor.com\\/experiment-optimized-asset-loading\\/\\\">Developer Documentation<\\/a>)<\\/li>\\n<li>Tweak: Added Compatibility Tag support in Elementor Pro (<a href=\\\"https:\\/\\/developers.elementor.com\\/compatibility-tag\\/\\\">Developer Documentation<\\/a>)<\\/li>\\n<li>Tweak: Added Dynamic capabilities to Rotating Text animation in Animated Headline widget (#4625, #8569)<\\/li>\\n<li>Tweak: Added an option to set Selected color for Typing effect in Animated Headline widget (#5403, #7826)<\\/li>\\n<li>Tweak: Added animation Loop option for Animated Headline (#9749, #2457)<\\/li>\\n<li>Tweak: Added timing options for Animated Headline widget (#4392)<\\/li>\\n<li>Tweak: Added dynamic capabilities for Testimonial Carousel widget (#8569)<\\/li>\\n<li>Tweak: Added dynamic capabilities for Price Table widget (#4242, #8569)<\\/li>\\n<li>Tweak: Added Word Wrap control to Code Highlight widget (#13577)<\\/li>\\n<li>Tweak: Upgraded Font Awesome Pro library to v5.15.1<\\/li>\\n<li>Tweak: Improved method of loading field mapping repeater in Form widget (<a href=\\\"https:\\/\\/developers.elementor.com\\/how-to-add-a-repeater-control-to-elementor-add-on\\/\\\">Developer Documentation<\\/a>)<\\/li>\\n<li>Tweak: Added &quot;Show on Browsers&quot; Popup Advanced Rule<\\/li>\\n<li>Tweak: Added real-time JS handling to prevent redundant renders in Slides widget and all Carousel widgets<\\/li>\\n<li>Tweak: Import scroll utility from core and remove it from Pro<\\/li>\\n<li>Tweak: Added alignment options for Post Excerpt widget<\\/li>\\n<li>Tweak: Changed alignment control to work with selectors in Share Buttons<\\/li>\\n<li>Tweak: Upgraded to Webpack 5, Grunt-Webpack 4 and TerserPlugin instead of UglifyJsPlugin<\\/li>\\n<li>Fix: Steps Divider is not vertically aligned in Multi Step Form widget (#12569) <\\/li>\\n<li>Fix: Slides are playing in an infinite loop mode even when the option is disabled in Slides Widget (#6726)<\\/li>\\n<li>Fix: Step buttons text is not updated without a page reload in Forms widget <\\/li>\\n<li>Fix: Overflow issue in certain animations in Animated Headline widget <\\/li>\\n<li>Fix: When dragging a new Testimonial Carousel there is a console error thrown<\\/li>\\n<li>Fix: Step Buttons are cut in mobile view in Multi Step Form <\\/li>\\n<li>Fix: Submit and Step buttons size differences when using Twenty Twenty theme<\\/li>\\n<li>Fix: Duplicate button Text Color control in Slides widget<\\/li>\\n<li>Fix: JS error is thrown when editing and saving global widgets<\\/li>\\n<li>Fix: <code>get_version<\\/code> API function may fail with Redis \\/ DB cache<\\/li>\\n<li>Fix: Multiple license check requests are created in certain cases<\\/li>\\n<li>Deprecated: Deprecate methods prefixed with an underscore and replace them with unprefixed methods<\\/li>\\n<li>Deprecated: See all deprecations to this version in our <a href=\\\"https:\\/\\/developers.elementor.com\\/v3-1-planned-deprecations\\/\\\">Developers Deprecations Post<\\/a><\\/li>\\n<\\/ul>\\n<h4>3.1.0-dev1 - 2021-01-11<\\/h4>\\n<ul>\\n<li>initial version<\\/li>\\n<\\/ul>\\\";}\",\"new_version\":\"3.9.0-dev2\",\"name\":\"Elementor Pro\",\"slug\":\"elementor-pro\",\"url\":\"https:\\/\\/elementor.com\\/pro\\/changelog\\/\",\"homepage\":\"https:\\/\\/elementor.com\\/pro\\/\",\"requires\":\"5.0\",\"tested\":\"6.0.2\",\"elementor_requires\":\"3.0.1\",\"package\":\"https:\\/\\/plugin-downloads.elementor.com\\/v1\\/plugin\\/dev-edition\\/MTY2NTQxMTE3NDphY3RpdmF0ZWQ6MTozLjkuMC1kZXYyOmIzNzM2ZWVjZTliMGEzYWY4NGI3NWY2Y2ExZWU1ZGYyOmh0dHBALy9sb2NhbGhvc3QvaGVsbG8td29yZHByZXNzL3dvcmRwcmVzcw==\",\"download_link\":\"https:\\/\\/plugin-downloads.elementor.com\\/v1\\/plugin\\/dev-edition\\/MTY2NTQxMTE3NDphY3RpdmF0ZWQ6MTozLjkuMC1kZXYyOmIzNzM2ZWVjZTliMGEzYWY4NGI3NWY2Y2ExZWU1ZGYyOmh0dHBALy9sb2NhbGhvc3QvaGVsbG8td29yZHByZXNzL3dvcmRwcmVzcw==\",\"banners\":{\"2x\":\"https:\\/\\/ps.w.org\\/elementor\\/assets\\/banner-1544x500.png?rev=1475479\",\"1x\":\"https:\\/\\/ps.w.org\\/elementor\\/assets\\/banner-772x250.png?rev=1475479\"},\"icons\":{\"svg\":\"https:\\/\\/storage.googleapis.com\\/web-public-files\\/Web%20Assets\\/icons\\/icon.svg\"},\"cloud\":false}\";}', 'yes');
