(8, 1, '2022-09-20 03:24:32', '2022-09-20 03:24:32', '<!-- wp:template-part {\"slug\":\"header-small-dark\",\"theme\":\"twentytwentytwo\",\"tagName\":\"header\"} /-->\n\n<!-- wp:query {\"queryId\":0,\"query\":{\"perPage\":10,\"pages\":0,\"offset\":0,\"postType\":\"post\",\"order\":\"desc\",\"orderBy\":\"date\",\"author\":\"\",\"search\":\"\",\"exclude\":[],\"sticky\":\"\",\"inherit\":true},\"tagName\":\"main\",\"displayLayout\":{\"type\":\"list\"},\"layout\":{\"inherit\":true}} -->\n<main class=\"wp-block-query\"><!-- wp:post-template {\"align\":\"wide\"} -->\n<!-- wp:group {\"layout\":{\"inherit\":true}} -->\n<div class=\"wp-block-group\"><!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"width\":\"650px\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:650px\"><!-- wp:paragraph -->\n<p>chào tất cả các bạn nha ahjhj</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"\"} -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"112px\"} -->\n<div style=\"height:112px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\n<!-- /wp:post-template -->\n\n<!-- wp:query-pagination {\"paginationArrow\":\"arrow\",\"align\":\"wide\",\"layout\":{\"type\":\"flex\",\"justifyContent\":\"space-between\"}} -->\n<!-- wp:query-pagination-previous {\"fontSize\":\"small\"} /-->\n\n<!-- wp:query-pagination-numbers /-->\n\n<!-- wp:query-pagination-next {\"fontSize\":\"small\"} /-->\n<!-- /wp:query-pagination --></main>\n<!-- /wp:query -->\n\n<!-- wp:template-part {\"slug\":\"footer\",\"theme\":\"twentytwentytwo\",\"tagName\":\"footer\"} /-->', 'Trang chủ', 'Hiển thị các bài viết trên trang chủ hoặc trên trang bài viết nếu đã cài một trang chủ tĩnh.', 'publish', 'closed', 'closed', '', 'home', '', '', '2022-09-20 03:26:53', '2022-09-20 03:26:53', '', 0, 'http://localhost/hello-wordp